import React, { Component } from "react";
import axios from "axios";


class Main extends Component {
    constructor(props) {
        super(props);

        this.state = {
            Tasks: []
        }
    }

    createTaskList = () => {
        axios
            .get("/api/tasks/")
            .then((res) => {
                const data = res.data
                console.log(data)
                const tasks = data.map(task =>
                    <div key={task.id}>
                        <p>{task.id}</p>
                        <p>{task.task}</p>
                        <p>{task.body}</p>
                        <p>{task.timestamp}</p>
                        <p>{task.completed}</p>
                    </div>
                )

                this.setState({
                    tasks
                })
            })

            .catch((error) => {
                console.log(error)
            })
    };

    componentDidMount(){
        this.createTaskList()
    }

    render() {

        return (

            <div>
                {this.state.Tasks}
            </div>
        )
    }
}

export default Main;
